青りんごの香りがやさしい、猫砂・ネコ砂(香るタイプ)です。おからのフラボノイドでイヤなニオイを消し去ります。猫の足につきにくく、ころがりにくい形状で飛び散りをおさえます。土にもどるのでお庭に埋めても安全。トイレに流せるので手間いらず。可燃ゴミにも出せます。使用方法1)ペットのトイレに本品を底より5cmほどの厚さにしきつめて、ご使用ください。(ペットトイレはスノコなしをオススメします。)2)オシッコをすばやく吸収し、瞬時に固めてしまいます。3)オシッコで固まった部分だけを取り除き、あとは少なくなった分を補充してください。4)半年に一度位、古い砂が上に、新しい砂が下になる様に入れ替えてください。使用上の注意※猫は環境に敏感で、すぐには慣れないことがあります。そのときは、現在お使いの砂に少しずつ混ぜて徐々に切り替えてください。※スノコ式のトイレを使用すると、オシッコがスノコの下に落ちてニオイの原因になることがありますので、スノコなしのトイレをおすすめします。※水洗トイレに流す場合、一度に大量に流すと配水管を詰まらせるおそれがありますので、1回に流す量は200cc(コップ1杯分)程度にしてください。※長時間放置して硬く固まった砂は、トイレに流さないでください。※開封後は、封をした上、直射日光をさけて風通しの良い乾燥した場所に保存してください。※おからと食品添加物からできていますので万一食べても害はありませんが、誤って多量に口にした場合は医師の診断を受けてください。※固まりが弱くなる場合がございますので、製造日より2年以内に使い切ってください。※猫のトイレの砂としての用途以外には使用しないでください。※空袋は子供の手の届かない所に保管し、おもちゃにさせないでください。成分おから、炭酸カルシウム、コーンスターチ、食用色素、香料、他<br><br>原産国：日本<br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
